import React, {Component} from 'react';
import {ListGroup, Row, Col, Button} from 'react-bootstrap';

class MyInfo extends Component {
    render(){
        return(
            <div>
                <Row>
                    <Col sm>게시글 수</Col>
                    <Col sm>관심 토픽</Col>
                    <Col sm>관심 글</Col>
                </Row>
            </div>
        );
    }
}

export default MyInfo;
